			'ADDED_EXISTING', 
			id, 
			name, 
			`$household_hist`, 
            `is_active`,
			last_modified
		FROM area
        WHERE id = `$area_id`;
        
        SET `$area_hist` = LAST_INSERT_ID();
    END IF;
    
	RETURN `$area_hist`;
