	DECLARE `$done` INT DEFAULT FALSE;
    DECLARE `$medication_name` VARCHAR(50);
    DECLARE `$class_id_1`, `$class_id_2` VARCHAR(5);
    DECLARE `$interaction_cnt` INT;
    
