					C.`CLASSID`
				FROM `medispan`.`D01CLASS_C` C
					JOIN `medispan`.`DRUGNAME2KDC_B` D ON D.`KDC1` = C.`KDC1`
					JOIN `sophic_medical`.`prescription` P
